import React from "react";
import './navigation.css'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Section = ({}) =>{
    return(
        <div className="tc ">
      <Container>
      <Row className="bg23">
        <Col className='pt-5 pb-5'>
          <h3 className="text-center">
          <img src="https://wazirx.com/static/media/art-line-device.b62af98e.png" width={'100px'} height={'auto'}/>

          </h3>
        </Col>
        <Col className='pt-5'>
          <h3 className="text-center">
          <img src="https://wazirx.com/static/media/headerImage.4e815cf9.png" id={'img23'}/>
          </h3>
        </Col>
      </Row>
    </Container>
          {/* <div className="bg23 tc">
            <img src="https://wazirx.com/static/media/art-line-device.b62af98e.png" width={'100px'} height={'auto'}/>
          </div> */}
        </div>
    )
}

export default Section
